import React from 'react'
import "../styles/ListItem.css"
import Message from "./Message";
import Info from "./Info";

export default function ListItem({item, type, user}) {

    return (
        <div className={"listItem"}>
            {
                item.type === "info" ? (
                    <Info item={item}/>
                ) : (
                    <Message item={item} user={user}/>
                )
            }
        </div >
    )
}
